Promotional info - &quot;After the INFINITE CRISIS, the DC Universe spent a year without Superman, Batman and Wonder WomanÃ¢â‚¬â€a year in which those heroes were needed more than ever as the fate of the world hung in the balance.This is 52, a four-volume collection of the unprecedented, critically acclaimed weekly series of death, danger, romance, terror and the never-ending search for heroism in the DC Universe's most eventful year ever.52 features the best and brightest writers from the comic-book field including Geoff Johns (INFINITE CRISIS), Grant Morrison (ALL STAR SUPERMAN), Greg Rucka (WONDER WOMAN) and Mark Waid (KINGDOM COME), working together to tell the tale of a world awakening from a nightmare to face a new day. 52: A year without Superman; a year without Batman; a year without Wonder WomanÃ¢â‚¬Â¦but not a year without heroes.&quot;

This was one of those high-concept large scale events done right. All four of the amazing authors mentioned above had already established themselves as premier writers in the industry, and the level of overlapping detail and wonderful individual stories in this series just proved it further. With Final Crisis and especially Countdown elicit mixed reactions, this series remains a high-water mark for DC and is worth reading for sure. These brilliant new HD copies are courtesy of Monafekk-Empire, thanks to them for their work - please seed and enjoy! :-)
